import './App.css';
import Signup from './component/Signup';
import Login from './component/Login';
import {Routes,Route} from "react-router-dom"
import Navbar from './component/Navbar';


function App() {
  return (
    <>
    <Navbar/>
    <Routes>
    <Route path='' element={<Signup/>}/>
    <Route path='' element={<Login/>}/>
    </Routes>
    </>
  );
}

export default App;
